import React, { useState } from 'react';

const App = () => {
    // Hardcoded seed data to make the app functional without a backend server.
    const seedData = {
        dashboard: {
            total_properties: 42,
            total_tenants: 150,
            total_leases: 125,
            available_units: 18,
            total_rent_due: 15450.75,
        },
        properties: {
            title: 'Properties Page',
            message: 'This page shows a static list of all your properties. The data is pre-loaded to demonstrate the app\'s functionality.'
        },
        tenants: {
            title: 'Tenants Page',
            message: 'This page will show a list of all your tenants. This data is static.'
        },
        agents: {
            title: 'Agents Page',
            message: 'This page will show a list of all your agents. This data is static.'
        },
        leases: {
            title: 'Leases Page',
            message: 'This page will show a list of all your leases. This data is static.'
        },
        payments: {
            title: 'Payments Page',
            message: 'This page will show a list of all your payments. This data is static.'
        },
        reports: {
            title: 'Reports Page',
            message: 'This page will generate reports on your properties and income. This data is static.'
        },
        settings: {
            title: 'Settings Page',
            message: 'Customize your experience here. Select a theme from the buttons above.'
        },
        units: {
            title: 'Units Page',
            message: 'This page will show a list of all your units. This data is static.'
        }
    };

    const themes = {
        light: {
            primary: '#007bff',
            background: '#f4f7f9',
            card: '#ffffff',
            text: '#333333',
            link: '#007bff',
            sidebar: '#ffffff',
            border: '#e9ecef',
        },
        dark: {
            primary: '#4c9aff',
            background: '#121212',
            card: '#1e1e1e',
            text: '#ffffff',
            link: '#4c9aff',
            sidebar: '#1e1e1e',
            border: '#333333',
        },
        blue: {
            primary: '#007bff',
            background: '#e9f5ff',
            card: '#ffffff',
            text: '#333333',
            link: '#007bff',
            sidebar: '#ffffff',
            border: '#cce5ff',
        },
        teal: {
            primary: '#008080',
            background: '#e6f7f7',
            card: '#ffffff',
            text: '#333333',
            link: '#008080',
            sidebar: '#ffffff',
            border: '#c4e0e0',
        },
    };

    const [page, setPage] = useState('dashboard');
    const [theme, setTheme] = useState('light');
    const [searchQuery, setSearchQuery] = useState('');

    const currentTheme = themes[theme];

    // Sidebar component as a function
    const Sidebar = () => {
        const navLinks = [
            { name: 'Dashboard', page: 'dashboard' },
            { name: 'Properties', page: 'properties' },
            { name: 'Tenants', page: 'tenants' },
            { name: 'Agents', page: 'agents' },
            { name: 'Leases', page: 'leases' },
            { name: 'Payments', page: 'payments' },
            { name: 'Reports', page: 'reports' },
            { name: 'Settings', page: 'settings' },
            { name: 'Units', page: 'units' },
        ];

        return (
            <div style={{
                width: '250px',
                minWidth: '250px',
                backgroundColor: currentTheme.sidebar,
                color: currentTheme.text,
                padding: '20px',
                borderRight: `1px solid ${currentTheme.border}`,
                display: 'flex',
                flexDirection: 'column',
                height: '100vh',
                boxSizing: 'border-box'
            }}>
                <h2 style={{ fontSize: '24px', fontWeight: 'bold', marginBottom: '40px', color: currentTheme.primary }}>
                    My App
                </h2>
                <nav>
                    <ul style={{ listStyle: 'none', padding: 0 }}>
                        {navLinks.map((link) => (
                            <li key={link.page} style={{ marginBottom: '15px' }}>
                                <button
                                    type="button"
                                    onClick={() => setPage(link.page)}
                                    style={{
                                        display: 'flex',
                                        alignItems: 'center',
                                        textDecoration: 'none',
                                        padding: '10px 15px',
                                        borderRadius: '8px',
                                        transition: 'background-color 0.3s',
                                        backgroundColor: page === link.page ? currentTheme.primary : 'transparent',
                                        color: page === link.page ? 'white' : currentTheme.text,
                                        border: 'none',
                                        width: '100%',
                                        textAlign: 'left',
                                        cursor: 'pointer',
                                    }}
                                >
                                    {link.name}
                                </button>
                            </li>
                        ))}
                    </ul>
                </nav>
            </div>
        );
    };

    // Topbar component as a function
    const Topbar = () => {
        return (
            <div style={{
                backgroundColor: currentTheme.card,
                color: currentTheme.text,
                padding: '20px',
                borderBottom: `1px solid ${currentTheme.border}`,
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'space-between',
            }}>
                <div style={{ position: 'relative', width: '300px' }}>
                    <input
                        type="text"
                        placeholder="Search..."
                        value={searchQuery}
                        onChange={(e) => setSearchQuery(e.target.value)}
                        style={{
                            width: '100%',
                            padding: '10px 40px 10px 15px',
                            borderRadius: '25px',
                            border: `1px solid ${currentTheme.border}`,
                            backgroundColor: currentTheme.background,
                            color: currentTheme.text,
                            outline: 'none',
                        }}
                    />
                </div>
                <div style={{ display: 'flex', alignItems: 'center' }}>
                    <button
                        onClick={() => setTheme('light')}
                        style={{
                            padding: '8px 15px',
                            marginRight: '10px',
                            borderRadius: '20px',
                            border: 'none',
                            backgroundColor: currentTheme.primary,
                            color: '#ffffff',
                            cursor: 'pointer',
                        }}
                    >
                        Light
                    </button>
                    <button
                        onClick={() => setTheme('dark')}
                        style={{
                            padding: '8px 15px',
                            marginRight: '10px',
                            borderRadius: '20px',
                            border: 'none',
                            backgroundColor: currentTheme.primary,
                            color: '#ffffff',
                            cursor: 'pointer',
                        }}
                    >
                        Dark
                    </button>
                    <button
                        onClick={() => setTheme('blue')}
                        style={{
                            padding: '8px 15px',
                            marginRight: '10px',
                            borderRadius: '20px',
                            border: 'none',
                            backgroundColor: currentTheme.primary,
                            color: '#ffffff',
                            cursor: 'pointer',
                        }}
                    >
                        Blue
                    </button>
                    <button
                        onClick={() => setTheme('teal')}
                        style={{
                            padding: '8px 15px',
                            borderRadius: '20px',
                            border: 'none',
                            backgroundColor: currentTheme.primary,
                            color: '#ffffff',
                            cursor: 'pointer',
                        }}
                    >
                        Teal
                    </button>
                </div>
            </div>
        );
    };

    // Generic Page component for other sections
    const GenericPage = ({ title, message }) => (
        <div style={{ flex: 1, padding: '20px', backgroundColor: currentTheme.background, color: currentTheme.text }}>
            <h1 style={{ fontSize: '2rem', fontWeight: 'bold' }}>{title}</h1>
            <p style={{ marginTop: '1rem' }}>{message}</p>
        </div>
    );

    const Dashboard = () => {
        const summary = seedData.dashboard;
        return (
            <div style={{ flex: 1, padding: '20px', backgroundColor: currentTheme.background, overflowY: 'auto' }}>
                <h1 style={{ color: currentTheme.text, fontSize: '2rem', fontWeight: 'bold' }}>Dashboard Overview</h1>
                <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', gap: '20px', marginTop: '20px' }}>
                    <div style={{ backgroundColor: currentTheme.card, padding: '20px', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' }}>
                        <h3 style={{ color: currentTheme.primary, fontSize: '1.25rem', fontWeight: '600' }}>Total Properties</h3>
                        <p style={{ fontSize: '2.5rem', fontWeight: 'bold', color: currentTheme.text, marginTop: '0.5rem' }}>{summary.total_properties}</p>
                    </div>
                    <div style={{ backgroundColor: currentTheme.card, padding: '20px', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' }}>
                        <h3 style={{ color: currentTheme.primary, fontSize: '1.25rem', fontWeight: '600' }}>Total Tenants</h3>
                        <p style={{ fontSize: '2.5rem', fontWeight: 'bold', color: currentTheme.text, marginTop: '0.5rem' }}>{summary.total_tenants}</p>
                    </div>
                    <div style={{ backgroundColor: currentTheme.card, padding: '20px', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' }}>
                        <h3 style={{ color: currentTheme.primary, fontSize: '1.25rem', fontWeight: '600' }}>Total Leases</h3>
                        <p style={{ fontSize: '2.5rem', fontWeight: 'bold', color: currentTheme.text, marginTop: '0.5rem' }}>{summary.total_leases}</p>
                    </div>
                    <div style={{ backgroundColor: currentTheme.card, padding: '20px', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' }}>
                        <h3 style={{ color: currentTheme.primary, fontSize: '1.25rem', fontWeight: '600' }}>Available Units</h3>
                        <p style={{ fontSize: '2.5rem', fontWeight: 'bold', color: currentTheme.text, marginTop: '0.5rem' }}>{summary.available_units}</p>
                    </div>
                    <div style={{ backgroundColor: currentTheme.card, padding: '20px', borderRadius: '8px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)' }}>
                        <h3 style={{ color: currentTheme.primary, fontSize: '1.25rem', fontWeight: '600' }}>Total Rent Due</h3>
                        <p style={{ fontSize: '2.5rem', fontWeight: 'bold', color: currentTheme.text, marginTop: '0.5rem' }}>${summary.total_rent_due ? summary.total_rent_due.toFixed(2) : '0.00'}</p>
                    </div>
                </div>
            </div>
        );
    };

    const renderPage = () => {
        switch (page) {
            case 'dashboard':
                return <Dashboard />;
            case 'properties':
                return <GenericPage title={seedData.properties.title} message={seedData.properties.message} />;
            case 'tenants':
                return <GenericPage title={seedData.tenants.title} message={seedData.tenants.message} />;
            case 'agents':
                return <GenericPage title={seedData.agents.title} message={seedData.agents.message} />;
            case 'leases':
                return <GenericPage title={seedData.leases.title} message={seedData.leases.message} />;
            case 'payments':
                return <GenericPage title={seedData.payments.title} message={seedData.payments.message} />;
            case 'reports':
                return <GenericPage title={seedData.reports.title} message={seedData.reports.message} />;
            case 'settings':
                return <GenericPage title={seedData.settings.title} message={seedData.settings.message} />;
            case 'units':
                return <GenericPage title={seedData.units.title} message={seedData.units.message} />;
            default:
                return <Dashboard />;
        }
    };

    return (
        <div style={{ display: 'flex', minHeight: '100vh', fontFamily: 'Inter, sans-serif', backgroundColor: currentTheme.background, color: currentTheme.text }}>
            <Sidebar />
            <div style={{ flex: 1, display: 'flex', flexDirection: 'column' }}>
                <Topbar />
                {renderPage()}
            </div>
        </div>
    );
};

export default App;
